@ae_1975_ วิกฤติการณ์ โควิด-19 นี้ 
ไม่ได้มีผลแค่ด้านเศรษฐกิจตกต่ำ The Great Depression อีกครั้ง เท่านั้น   
ยังมีผลด้านสังคมมากมาย เช่นเดียวกัน ตัวอย่าง จำนวนคนบางประเภท บางเมือง บางกลุ่ม อาจหายไปเพราะพ่ายแพ้ต่อไวรัส  การกระจายของประชากรจะผิดแปลกไป คราวนี้จะกลับมาเป็นแบบเดิมก็ใช้เวลานาน

@LunHua12 อยากให้โควิด๑๙ สอนพวกเรา ช่วยกันคิด ช่สยกันสิเคราะห์
   ชีวิตที่จะอยู่ต่อไปต้องดูแลตัวเอง และคนรอบข้างที่เรารัก ใส่ใจในการนำสิ่งดี เช่นความรู้มาใช้ให้ถูกต้อง มีสติตลอดเวลา มองอะไรให้ยาวไว้ แต่อยู่กับตัวและใจตลอดเวลา 
  สงกรานต์นี้ ขอให้ พบสิ่งที่คาดหวัง นะครับผม

